import React from 'react';

function SideDrawer(){
    return(
        <div className="side-drawer-class">
            <ul>
                <li>Passion</li>
                <li>Projects</li>
                <li>Contact</li>
            </ul>
        </div>
    )
}

export default SideDrawer;
